import { useState} from "react";
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import Input from '../../components/utils/regex/input';
import Api from '../../services/api';

import './style.css';


toast.configure();

export default function Register() {

  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [crm, setCrm] = useState('');
  const [cpf, setCpf] = useState('');
  const [phone, setPhone] = useState('');
  const [specialization, setSpecialization] = useState('');

  async function submitOn() {
    const data = {
      name: name,
      email: email,
      password: password,
      crm: crm,
      cpf: cpf,
      phone: phone,
      specialization: specialization
    }

    const response = await Api.post('doctorSignUp', data);
    
    if(response.value === 401){
      alert('>>>>>>>>>>>>>>>>');
    }
    
}


return (
  <div className={"Principal"}>

    <div> <a href="/"><img src="https://i.imgur.com/tDvwyyA.png" className={'logo'} title="source: imgur.com" /></a></div>
    <h1>Cadastro</h1>
    <h2>Preencha as Informações abaixo</h2>
    <br></br>
    <br></br>
      
    <form className={"divCenter"}>
      <div >
        <label className={"text"}>Nome</label>
        <br></br>
        <Input name="name" id="name" type="text"
          onChange={e => setName(e.target.value)}
          
        />
        
      </div>
      <br></br>
      <div>
        <label className={"text"}>Email</label>
        <br></br>
        <Input name="email" id="email"

          onChange={e => setEmail(e.target.value)}
          type="email" />
      </div>
      <div>
        <label className={"text"}>CPF</label>
        <br></br>
        <Input mask="cpf" name="cpf" type="text" id="cpf"

          onChange={e => setCpf(e.target.value)}
        />
      </div>
      <div>
        <label className={"text"}>CRM</label>
        <br></br>
        <Input mask="crm" id="crm" name="crm" type="text"

          onChange={e => setCrm(e.target.value)}
        />
      </div>
      <div>
        <label className={"text"}>Especialização</label>
        <br></br>
        <Input name="specialization" id="crm" type="text"

          onChange={e => setSpecialization(e.target.value)}
        />
      </div>
      <div>
        <label className={"text"}>Telefone</label>
        <br></br>
        <Input mask="telefone" id="phone" name="phone"
          onChange={e => setPhone(e.target.value)}
        />
      </div>
      <div>
        <label className={"text"}>Senha</label>
        <br></br>
        <Input mask="password" id="password" name="password"

          onChange={e => setPassword(e.target.value)}
        />
      </div>
    </form>
    <button type="submit" onClick={submitOn}>Enviar</button>
  </div>
);
}
